def printChar(char):
    ret = []
    c = font[char]
    for i in c:
        a = ""
        for j in range(0,8):
            b = ((i >> j) & 1) != 0
            m = "X" if b else " "
            a = a + str(m);
        ret.append(a) 
    return ret

